import React, { Component } from 'react';
import './App.css';
import Navigation from './componoents/Navigation/Navigation';
import Logo from './componoents/Logo/Logo';
import ImageLinkForm from './componoents/ImageLinkForm/ImageLinkForm';
import Rank from './componoents/Rank/Rank';
import Particles from 'react-particles-js';

const ParticlesOption = {
  particles: {
    number: {
      value: 80,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}

class App extends Component {
  constructor(){
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event);
  }

  render(){
    return (
      <div className="App">
        <Particles className='particles'
          params={ParticlesOption} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange}/>
        {/* <FaceRecognition /> */}
      </div>
    );
  }
}


export default App;
